window.bookSummaryJSON = "<p><b>I thought the fight was over.</b></p> <p>That I'd finally found a home for me and my family. That I'd found a new beginning.</p> <p>How wrong was I?</p> <p>All my efforts just led me to a new beginning of the end.</p> <p>Echo City was on the verge of destruction, and my plan of trying to stop the unstoppable involved all three of them.</p> <p>The three Kings.</p> <p>Forming the most dangerous union.</p> <p>Deadlier than ever before.</p> <p>Hungrier than ever before.</p> <p>Darker than ever before.</p> <p>And as all kings, they offered nothing for free, each one demanding the price of my body in return, continuing their devious games, gradually breaking me.</p> <p>Passionate, mesmerizing, and wicked, forming a dark alliance to conquer it all. Including me!</p> <p>The three devils united into a sinful team.</p> <p><i>Kings of Lust!</i></p> <p>Kings of Lust <i>is a dark college bully reverse harem romance and is book two of The Pleasure Room series.</i></p> <p><i>No angels allowed between these lines, no Prince Charming, just sinful desires.</i></p> <p>The Kings of Lust<i> is not recommended for the weak of heart or for those who are looking for a perfect love story. This book is dark, and twisted, pushing boundaries and imagination. For mature listeners.</i></p>"; 
